func buildGoogleSearchURL(query string) string {
    return fmt.Sprintf("https://www.google.com/search?q=%s", urlEncode(query))
}

func urlEncode(s string) string {
    encoded := strings.Map(func(r rune) rune {
        if r == ' ' {
            return '%20'
        }
        return r
    }, s)
    return encoded
}

func fetchGoogleResults(url string) ([]string, error) {
    resp, err := http.Get(url)
    if err != nil {
        return nil, err
    }
    defer resp.Body.Close()

    // Read the response body
    scanner := bufio.NewScanner(resp.Body)
    urls := make([]string, 0, 100)

    for scanner.Scan() {
        links := extractLinks(scanner.Text())
        urls = append(urls, links...)
    }

    if err := scanner.Err(); err != nil {
        return nil, err
    }

    return urls, nil
}

func extractLinks(s string) []string {
    re := regexp.MustCompile(`href="(http[^"]+)["&]``)
    links := re.FindAllSubmatch(s, -1)
    fmt.Printf("Raw Links: %+v\n", links)

    // Clean and validate links
    urls := make([]string, len(links))
    for i, link := range links {
        urls[i] = strings.Trim(link[1], `"`).Trim(startUrl, endUrl)
        if strings.ContainsAny(urls[i], startUrl) || strings.ContainsAny(urls[i], endUrl) {
            urls[i] = ""
        }
        if urls[i] == "" {
            continue
        }
        fmt.Printf("Valid Links: %+v\n", urls)

        // Search for Gopher-snippet URLs
        snippetUrls := findGopherSnippetUrls(urls, i)

        // Update the list with only relevant Gopher-snippet URLs
        for _, u := range snippetUrls {
            if !strings.Contains(u, "://gopher.google.com/s", -1) {
                continue
            }
            urls[i] = u
        }
    }
    return urls
}

func findGopherSnippetUrls(urls []string, index int) []string {
    snippetUrls := make([]string, 0, len(urls))
    for _, url := range urls {
        if url != "" && strings.Contains(url, "[CodeSnippet]") {
            snippetUrls = append(snippetUrls, url)
        }
    }
    return snippetUrls
}

const (
    startUrl    = `start=q`
    endUrl      = `&sa=`
)

func main() {
    // Code implementation goes here.
}
```

