Yes, indeed there is a way to read a single character from the user input across multiple platforms. Here's a solution using the `getch()` function that works in both Windows and Unix-based systems such as macOS. To achieve cross-platform compatibility, we can utilize two methods: one for Windows using the `msvcrt` library (in C) and another for Unix using `termios` (in C).

For a simpler and more portable C solution, we can create a custom `getch()` function, which dynamically checks for the platform and picks the compatible method:

```c
#include <stdio.h>
#include <stdlib.h>
#include <termios.h>
#include <unistd.h>
#include <windows.h>

#ifdef _WIN32
#include <msvcrt.h>
#define getch() _getch()
#else
static struct termios old_termios, new_termios;

void save_current_terminals_attributes(void)
{
    tcgetattr(STDIN_FILENO, &old_termios);
}

void restore_original_terminals_attributes(void)
{
    tcsetattr(STDIN_FILENO, TCSANOW, &old_termios);
}

char getch()
{
    char ch;
    struct termios old = {0};
    tcgetattr(STDIN_FILENO, &old);

    char new_baud_rate[128] = { 0 };
    bzero(new_baud_rate, sizeof(new_baud_rate));
    sprintf(new_baud_rate, "\033[%d;1R", 9999);
    tcsetattr(STDIN_FILENO, TCSANOW, &old);
    printf("%s", new_baud_rate);
    printf("%c", getchar());

    tcsetattr(STDIN_FILENO, TCSANOW, &old);

    return ch;
}
#endif

int main(void)
{
    char charFromUser = getch();

    return 0;
}
```

This code consists of a custom `getch()` implementation that uses a Windows-compatible method (`_getch`) and a Unix-compatible method (`tcgetattr` and `tcsetattr`). The `getch()` function will dynamically check the platform and choose the appropriate method based on the `#ifdef _WIN32` directive.

