Here's a simple C++ program that reads a text file line by line and counts the number of occurrences of a specific word:

```cpp
#include <iostream>
#include <fstream>
#include <string>

int main(int argc, char* argv[]) {
    if (argc != 3) {
        std::cerr << "Usage: " << argv[0] << " <input_file> <word_to_count>" << std::endl;
        return 1;
    }

    std::ifstream input_file(argv[1]);
    if (!input_file.is_open()) {
        std::cerr << "Error opening file: " << argv[1] << std::endl;
        return 1;
    }

    std::string word_to_count(argv[2]);
    int count = 0;
    std::string line;

    while (getline(input_file, line)) {
        size_t pos = 0;
        while ((pos = line.find(word_to_count, pos)) != std::string::npos) {
            ++count;
            pos += word_to_count.length();
        }
    }

    std::cout << "The word \"" << word_to_count << "\" appears " << count << " times in the file." << std::endl;

    return 0;
}
```

